import React, { Component } from "react";
import TextField from 'material-ui/TextField';
import RaisedButton from 'material-ui/RaisedButton';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
class App extends Component {
  stste={
    email :"",
    pass:""
  }

componentDidMount(){
  fetch('https://fakestoreapi.com/auth/login',{
            method:'POST',
            body:JSON.stringify({
                username: "farah",
                password: "1234"
            })
        })
            .then(res=>res.json())
            .then(json=>console.log(json))
}

  render () {return (
    <div style={{background:'#D3D3D3',width:'100%',height:'100%',position:'absolute', top:'0px', right:'0px',  bottom:'0px', left:'0px'}}>
    <div style={{ background:'#FFFFFF' ,border: '2px solid ' ,marginTop:100, width:500,height:600,marginLeft:500}} >


        <br/> <br/>
          <label style={{ marginLeft:150, fontSize:40 , fontFamily: "Times New Roman"}} >Login Page</label>
        <br/> <br/><br/> <br/><br/> <br/>

           <input style={{ marginTop:10, marginLeft:100 , width: '350px',  border: '2px solid ' ,height:30   }} 
             placeholder="User Name"
             onChange = {(event,newValue) => this.setState({username:newValue})}
             />
   <br/> <br/>
             <input  style={{ marginTop:10, marginLeft:100 , width: '350px',  border: '2px solid ' ,height:30     }} 
               type="password"
               placeholder=" password"
               onChange = {(event,newValue) => this.setState({pass:newValue})}
               />
             <br/><br/>  <br/> <br/>  <br/> <br/><br/> <br/>

             <button    onClick={(event) => this.handleClick(event)} style={{ height:50, marginTop:10, marginLeft:150, width: '250px',  border: '2px solid ',background:'#D3D3D3'}} >
        Login </button>




    </div>
    </div>
  );
}
}

export default App;
